const jwt = require('jsonwebtoken');
const { errorResponse } = require('../helpers/http-response');

const createToken = (userData) => {
    let token = jwt.sign(userData, process.env.SECRET_KEY || 'ffsfk23nknfbae451fnsdbjddmps4nfodjfew5f8kcsdiblwe3if', { expiresIn: '30d' });

    return token;
}

const verifyToken = (req, res, next) => {
    try {
        if (!req.headers.authorization) throw new Error("AUTH_NOT_FOUND");

        const auth = req.headers.authorization.split("Bearer ")[1];

        jwt.verify(auth, process.env.SECRET_KEY, (err, decodedData) => {
            if (err) {
                return res.status(403).json({ status: 403, message: "Invalid Token" });
            }
            else {
                req.user = decodedData;
                next();
            }
        });


    } catch (err) {
        if (err.name === "JsonWebTokenError")
            return res.status(401).json({ status: 401, message: err.message });

        if (err.name === "TokenExpiredError")
            return res.status(401).json({ status: 401, message: err.message });

        errorResponse(res, err);
    }
}

module.exports = { createToken, verifyToken };






